window.bookSummaryJSON = "<p>The third book in Erin Hunter's number-one nationally best-selling Warriors series </p> <p>Join the legion of fans who have made Erin Hunter's Warriors series a best-selling phenomenon. More thrilling adventures, epic action, and fierce warrior cats await in Warriors #3: <i>Forest of Secrets</i>. </p> <p>Allegiances are shifting among the Clans of warrior cats that roam the forest. With tensions so delicately balanced, friends can become enemies overnight, and some cats are willing to kill to get what they want. </p> <p>Fireheart is determined to find out the truth about the mysterious death of the former ThunderClan deputy Redtail. But as he searches for answers, he uncovers secrets that might be better left hidden.... </p>"; 
